import React from 'react';
import { Link } from 'react-router-dom';
import { Sidenav, Nav, Divider, Icon, Navbar } from 'rsuite';

const panelStyles = {
  padding: '15px 20px',
  color: '#aaa'
};

const headerStyles = {
  padding: 20,
  fontSize: 16,
  background: '#34c3ff',
  color: '#fff'
};

const Sidebar = () => {
  return (
    <div style={{ width: 250 }}>
      <Sidenav defaultOpenKeys={['3', '4']}>
        <Sidenav.Header>
          <div style={headerStyles}>Inventory Tracker</div>
        </Sidenav.Header>
        <Sidenav.Body>
          <Nav>
            <Nav.Item eventKey="1" active icon={<Icon icon="dashboard" />}>
              <Link to="/dashboard"> Dashboard </Link>
            </Nav.Item>
            <Nav.Item eventKey="2" icon={<Icon icon="list" />}>
              <Link to='/inventory'> Inventory </Link>
            </Nav.Item>
            <Nav.Item eventKey="3" icon={<Icon icon="retention" />}>
              <Link to='/recipes'> Recipes </Link>
            </Nav.Item>
            <Nav.Item eventKey="4" icon={<Icon icon="tag" />}>
              <Link to='/orders'> Orders </Link>
            </Nav.Item>
          </Nav>
        </Sidenav.Body>
      </Sidenav>
    </div>
  )
}

export default Sidebar;
